async function nyseUp(data, holderArr) {
    for (let i = 0; i < data.length; i++) {
        if (
          data[i].changesPercentage > 5 &&
          arr1.indexOf(data[i].symbol) > 0 &&
          data[i].price > 1
        ) {
            holderArr.push(data[i]);
        }
      }

}

modules.exports = {nyseUp}
